-- ###### Вариант A с одной таблицей ######
DROP TABLE IF EXISTS pg_range_a__kvs;
CREATE TABLE pg_range_a__kvs
(
    age        int           NOT NULL,
    experience int           NOT NULL,
    value      decimal(4, 2) NOT NULL,
    primary key (age, experience)
);
COMMENT ON COLUMN pg_range_a__kvs.age IS 'Возраст';
COMMENT ON COLUMN pg_range_a__kvs.experience IS 'Стаж';
COMMENT ON COLUMN pg_range_a__kvs.value IS 'Значение КВС';
COMMENT ON TABLE pg_range_a__kvs IS 'Коэффициент Возраст-Стаж, Вариант  А';

-- ###### Вариант B с 3 таблицами ######
DROP TABLE IF EXISTS pg_range_b__kvs_value;
DROP TABLE IF EXISTS pg_range_b__kvs_age_range;
DROP TABLE IF EXISTS pg_range_b__kvs_experience_range;

DROP SEQUENCE IF EXISTS pg_range_b__kvs_age_range_id_seq;
DROP SEQUENCE IF EXISTS pg_range_b__kvs_experience_range_id_seq;

-- Диапазоны возраста
create sequence pg_range_b__kvs_age_range_id_seq as integer;
create table pg_range_b__kvs_age_range (
    "id"   integer primary key not null default nextval('"pg_range_b__kvs_age_range_id_seq"'::regclass),
    "from" integer,
    "to"   integer
);
comment on table pg_range_b__kvs_age_range is 'Диапазоны возраста';
comment on column pg_range_b__kvs_age_range.from is 'Начало диапазона';
comment on column pg_range_b__kvs_age_range.to is 'Окончание диапазона';

-- Диапазоны опыта
create sequence pg_range_b__kvs_experience_range_id_seq as integer;
create table pg_range_b__kvs_experience_range (
    "id"   integer primary key not null default nextval('"pg_range_b__kvs_experience_range_id_seq"'::regclass),
    "from" integer,
    "to"   integer
);
comment on table pg_range_b__kvs_experience_range is 'Диапазоны стажа';
comment on column pg_range_b__kvs_experience_range.from is 'Начало диапазона';
comment on column pg_range_b__kvs_experience_range.to is 'Окончание диапазона';

-- Величина КВС
create table pg_range_b__kvs_value (
    "age_id"        integer not null,
    "experience_id" integer not null,
    "value"         numeric(4,2) not null,

    foreign key (age_id) references pg_range_b__kvs_age_range (id)
        match simple on update no action on delete no action,
    foreign key (experience_id) references pg_range_b__kvs_experience_range (id)
        match simple on update no action on delete no action
);
create unique index pg_range_b__kvs_value_pk on pg_range_b__kvs_value using btree (age_id, experience_id);
comment on table pg_range_b__kvs_value is 'Величина КВС';
comment on column pg_range_b__kvs_value.value is 'Величина КВС';

-- ###### Вариант С диапазонными типами ######
DROP TABLE IF EXISTS pg_range_c__kvs;
create table pg_range_c__kvs
(
    age        int4range not null,
    experience int4range not null,
    "value"    numeric(4, 2),

    constraint pg_range_c__kvs_pk
        exclude using gist (age WITH &&, experience WITH &&)
);
comment on table pg_range_c__kvs is 'Коэффициент Возраст-Стаж';
comment on column pg_range_c__kvs.age is 'Диапазоны возраста';
comment on column pg_range_c__kvs.value is 'Величина КВС';

-- ###### Вариант D с геометрией ######
DROP TABLE IF EXISTS pg_range_d__kvs;
create table pg_range_d__kvs
(
    "age_experience" box           not null,
    "value"          numeric(4, 2) not null,

    exclude using gist (age_experience WITH &&)
);
comment on column pg_range_d__kvs.age_experience is 'Возраст-Стаж';
comment on column pg_range_d__kvs.value is 'Значение КВС';
create unique index on pg_range_d__kvs using gist(age_experience);

